import React from 'react';
import {BrowserRouter, Switch, Route, NavLink} from 'react-router-dom';
import Test from '../pages/Test'

function Nav(){
    return (
        <BrowserRouter>
            <div>
                <ul>
                    <li>
                        <NavLink to="./App.js">Weather</NavLink>
                    </li>
                    <li>
                        <NavLink to="../pages/Test.js">5 Day Forecast</NavLink>
                    </li>
                </ul>
            </div>

             <Switch>
                 <Route path="./App.js"></Route>
                 <Route path="../pages/Test.js" component={Test}></Route>
            </Switch>
                {console.log("test")} 
         </BrowserRouter>
    )
}
export default Nav;
